```java
import java.util.Iterator;

public class ExperimentParameter<T extends Number> implements Iterable<T> {
    private T startValue;
    private T endValue;
    private T step;
    private boolean isRange;

    public ExperimentParameter(String input) {
        if (input.contains(":")) {
            String[] parts = input.split(":");
            if (parts.length != 3) {
                throw new IllegalArgumentException("Invalid format. Expected format is 'startValue:endValue:step'.");
            }
            try {
                startValue = (T) parseNumber(parts[0]);
                endValue = (T) parseNumber(parts[1]);
                step = (T) parseNumber(parts[2]);
                isRange = true;
            } catch (NumberFormatException e) {
                throw new IllegalArgumentException("Invalid number format in input string.", e);
            }
        } else {
            try {
                startValue = (T) parseNumber(input);
                isRange = false;
            } catch (NumberFormatException e) {
                throw new IllegalArgumentException("Invalid number format in input string.", e);
            }
        }
    }

    private Number parseNumber(String input) {
        if (input.contains(".")) {
            return Double.parseDouble(input);
        } else {
            return Integer.parseInt(input);
        }
    }

    public boolean isRange() {
        return isRange;
    }

    public T getStartValue() {
        return startValue;
    }

    public T getEndValue() {
        return endValue;
    }

    public T getStep() {
        return step;
    }

    @Override
    public Iterator<T> iterator() {
        if (!isRange) {
            throw new UnsupportedOperationException("Cannot iterate over a single-valued parameter.");
        }
        return new ExperimentParameterIterator();
    }

    private class ExperimentParameterIterator implements Iterator<T> {
        private Number currentValue = startValue;

        @Override
        public boolean hasNext() {
            return currentValue.doubleValue() <= endValue.doubleValue();
        }

        @Override
        @SuppressWarnings("unchecked")
        public T next() {
            Number nextValue = currentValue;
            if (startValue instanceof Integer) {
                currentValue = currentValue.intValue() + step.intValue();
            } else if (startValue instanceof Double) {
                currentValue = currentValue.doubleValue() + step.doubleValue();
            }
            return (T) nextValue;
        }
    }
}
```

