import java.util.Iterator;
import java.util.NoSuchElementException;

public class ExperimentParameter implements Iterator<Double> {
    private double startValue;
    private double endValue;
    private double step;
    private double currentValue;

    public ExperimentParameter(String str) throws ParseException {
        try {
            String[] splitted = str.split(":");
            if (splitted.length == 1) {
                this.startValue = this.endValue = this.currentValue = Double.parseDouble(splitted[0]);
                this.step = 0; \/\/ Single valued, no step
            } else if (splitted.length == 3) {
                this.startValue = this.currentValue = Double.parseDouble(splitted[0]);
                this.endValue = Double.parseDouble(splitted[1]);
                this.step = Double.parseDouble(splitted[2]);
            } else {
                throw new ParseException("Invalid string format", 0);
            }
        } catch (NumberFormatException e) {
            throw new ParseException("Unable to parse number", 0);
        }
    }

    @Override
    public boolean hasNext() {
        return currentValue <= endValue;
    }

    @Override
    public Double next() {
        if (!hasNext()) {
            throw new NoSuchElementException();
        }
        double ret = currentValue;
        currentValue += step;
        return ret;
    }
}
```

