public int TrinarySearch(int[] numbers, int value, int startIndex, int endIndex) {
    if (startIndex > endIndex) {
        return -1; \/\/ Element not found
    }

    int partitionSize = (endIndex - startIndex + 1) \/ 3; \/\/ Calculate the size of each partition

    int partitionOneIndex = startIndex + partitionSize;
    int partitionTwoIndex = endIndex - partitionSize;

    if (numbers[partitionOneIndex] == value) {
        return partitionOneIndex; \/\/ Element found in partition one
    } else if (numbers[partitionTwoIndex] == value) {
        return partitionTwoIndex; \/\/ Element found in partition two
    } else if (value < numbers[partitionOneIndex]) {
