        return TrinarySearch(numbers, value, startIndex, partitionOneIndex - 1);
    } else if (value > numbers[partitionTwoIndex]) {
        \/\/ Search in the third partition
        return TrinarySearch(numbers, value, partitionTwoIndex + 1, endIndex);
    } else {
        \/\/ Search in the second partition
        return TrinarySearch(numbers, value, partitionOneIndex + 1, partitionTwoIndex - 1);
    }
}
