    bool topologicalSort(std::vector<int>& result) {
        std::vector<int> visited(V, 0); \/\/ 0: unvisited, 1: visiting, 2: visited
        std::stack<int> stack;

        for (int i = 0; i < V; ++i) {
            if (visited[i] == 0) {
                if (!dfs(i, visited, stack)) {
                    return false; \/\/ Cycle detected
                }
            }
        }

        \/\/ If there was no cycle, the topological ordering is in the stack
        while (!stack.empty()) {
            result.push_back(stack.top());
            stack.pop();
        }

        return true; \/\/ No cycles, topological sort successful
    }

private:
    \/\/ Utility function for topological sort
    bool dfs(int v, std::vector<int>& visited, std::stack<int>& stack) {
        if (visited[v] == 1) {
            return false; \/\/ Cycle detected
        }

        if (visited[v] == 2) {
            return true; \/\/ Already visited, skip
        }

        \/\/ Mark the current node as visiting
        visited[v] = 1;

        \/\/ Recur for all the vertices adjacent to this vertex
        for (int i : adj[v]) {
            if (!dfs(i, visited, stack)) {
                return false; \/\/ Cycle detected in the DFS subtree
            }
        }

        \/\/ Mark the current node as visited
        visited[v] = 2;
        \/\/ Push current vertex to the stack, which stores the result
        stack.push(v);

        return true;
    }
