#include <iostream>
#include <vector>
#include <stack>

using namespace std;

vector<int> topologicalSort(const vector<vector<int>>& graph) {
    vector<int> result;
    vector<bool> visited(graph.size(), false);

    stack<int> s;
    for(int i = 0; i < graph.size(); i++) {
        if(!visited[i]) {
            bool hasCycle = dfs(graph, i, visited, s);
            if(hasCycle) {
                cout << "Graph has a cycle" << endl; 
                return {};
            }
        }
    }

    while(!s.empty()) {
        int node = s.top(); 
        s.pop();
        result.push_back(node);
    }
    return result;
}

bool dfs(const vector<vector<int>>& graph, int node, 
         vector<bool>& visited, stack<int>& s) {

    if(visited[node]) {
        return true; 
    }

    visited[node] = true;

    for(int neighbor : graph[node]) {
        if(!visited[neighbor]) {
           bool hasCycle = dfs(graph, neighbor, visited, s);
           if(hasCycle) {
               return true;
           }
        }
    }

    s.push(node);
    return false;
}
```

