In TypeScript, you can create a type that allows you to pick nested properties from an object by using template literal types along with recursive conditional types. TypeScript doesn't natively support deep picking directly through the built-in `Pick` type, so you'll have to define a custom type to achieve this.

Here's an example of how you can create such a type:

```typescript
type DeepPick<T, Path extends string> = Path extends `${infer Key}.${infer Rest}`
  ? Key extends keyof T
    ? { [K in Key]: DeepPick<T[Key], Rest> }
    : never
  : Path extends keyof T
  ? { [K in Path]: T[Path] }
  : never;

\/\/ Usage:
type A = {
  id: string;
  address: {
    street: {
      name: string;
      number: number;
    };
    zipCode: number;
  };
};

type Picked = DeepPick<A, 'id' | 'address.street.name'>;
\/\/ Picked type is equivalent to:
\/\/ {
\/\/   id: string;
\/\/   address: {
\/\/     street: {
\/\/       name: string;
\/\/     };
\/\/   };
\/\/ }
```

Let's break down the `DeepPick` type:
- `Path extends `${infer Key}.${infer Rest}``: This conditional type checks if the `Path` is a template literal type with a `.` separator, meaning it's a nested path.
- `Key extends keyof T`: This checks if the first part of the path (before the `.`) is a key of the type `T`.
- `{ [K in Key]: DeepPick<T[Key], Rest> }`: This maps over the keys and recursively applies `DeepPick` to the nested properties.
- `Path extends keyof T`: This checks if the `Path` is a direct key of the type `T`.
- `{ [K in Path]: T[Path] }`: This creates a type with the picked properties if it's a direct key.

