In C#, you can write a function to extract the n-th field of a '#' delimited string without allocating additional strings by using the `Span<T>` type which is a part of the `System` namespace. This type allows you to work with slices of arrays without creating new objects.

Here's an example of how you might implement such a function:

```csharp
using System;

public static class StringExtensions
{
    public static ReadOnlySpan<char> GetNthField(string input, int n, char delimiter = '#')
    {
        \/\/ A ReadOnlySpan<char> representing the input string
        ReadOnlySpan<char> span = input.AsSpan();

        int start = 0; \/\/ The start of the current field
        int end = 0; \/\/ The end of the current field
        int fieldIndex = 0; \/\/ The index of the current field

        while (fieldIndex <= n)
        {
            \/\/ Find the end of the current field
            end = span.Slice(start).IndexOf(delimiter);
            if (end == -1)
            {
                end = span.Length - start; \/\/ Last field or not found
            }

            if (fieldIndex == n)
            {
                \/\/ Return the current field
                return span.Slice(start, end);
            }

            \/\/ Move to the next field
            start += end + 1;
            if (start >= span.Length)
            {
                \/\/ If we reach the end of the string, return an empty span
                return ReadOnlySpan<char>.Empty;
            }

            \/\/ Increment the field index
            fieldIndex++;
        }

        \/\/ If we get here, the field wasn't found
        return ReadOnlySpan<char>.Empty;
    }
}

public class Program
{
    public static void Main()
    {
        string testString = "one#two#three#four#five";
        int fieldToExtract = 2; \/\/ Extracting the third field (index starts from 0)

        ReadOnlySpan<char> field = StringExtensions.GetNthField(testString, fieldToExtract);

        \/\/ Since the result is a ReadOnlySpan<char>, to convert it to a string,
        \/\/ you can use the ToString() method if necessary (which will allocate a new string).
        Console.WriteLine($"The {fieldToExtract + 1}-th field is: \"{field.ToString()}\"");
    }
}
```

In this example, the `GetNthField` function takes an input string, the field index `n`, and an optional delimiter (defaulting to `#`). It uses `ReadOnlySpan<char>` to traverse the string without allocating substrings. The `IndexOf` method is used to find the positions of the delimiters, and `Slice` is used to create spans that represent the fields.

Please note, `ReadOnlySpan<char>` is a stack-only type, meaning you cannot use it as a field in a class or return it from an iterator method. You can return it from regular methods as shown above. If you need to store the result in a field, you might need to convert it to a `string` or use `Memory<char>` instead, which would involve some allocation.

