The `RotateLeft` and `RotateRight` methods perform rotations to rebalance the tree. The `BalanceFactor` method calculates the balance factor of a node to determine whether it's unbalanced. If the balance factor is greater than 1 or less than -1, it means the tree is unbalanced at that node, and rotations are required to balance it.

