	private static final String INSERT_BOOK_SQL = "INSERT INTO books (title, author, available) VALUES (?, ?, ?)";
	private static final String SELECT_BOOK_BY_ID = "SELECT * FROM books WHERE id = ?";
	private static final String SELECT_ALL_BOOKS = "SELECT * FROM books LIMIT ?, ?";
	private static final String UPDATE_BOOK_SQL = "UPDATE books SET title = ?, author = ?, available = ? WHERE id = ?";
	private static final String DELETE_BOOK_SQL = "DELETE FROM books WHERE id = ?";
	private static final String SEARCH_BOOKS = "SELECT * FROM books WHERE title LIKE ? OR author LIKE ? LIMIT ?, ?";

	public Book createBook(Book book) {
		try (Connection connection = DatabaseUtil.getConnection();
				PreparedStatement preparedStatement = connection.prepareStatement(INSERT_BOOK_SQL,
						Statement.RETURN_GENERATED_KEYS)) {
			preparedStatement.setString(1, book.getTitle());
			preparedStatement.setString(2, book.getAuthor());
			preparedStatement.setBoolean(3, book.isAvailable());
			preparedStatement.executeUpdate();

			ResultSet resultSet = preparedStatement.getGeneratedKeys();
			if (resultSet.next()) {
				int id = resultSet.getInt(1);
				book.setId(id);
			}
		} catch (SQLException e) {
			e.printStackTrace();
		}
		return book;
	}

	public Book getBookById(int id) {
