        result.push_back(node);
    }
    return result;
}

bool dfs(const vector<vector<int>>& graph, int node, 
         vector<bool>& visited, stack<int>& s) {

    if(visited[node]) {
        return true; 
    }

    visited[node] = true;

    for(int neighbor : graph[node]) {
        if(!visited[neighbor]) {
           bool hasCycle = dfs(graph, neighbor, visited, s);
           if(hasCycle) {
               return true;
           }
        }
    }

    s.push(node);
    return false;
}
