#include <iostream>
#include <vector>
#include <stack>

class Graph {
private:
    int V; \/\/ Number of vertices
    std::vector<std::vector<int>> adj; \/\/ Adjacency list representation

public:
    Graph(int V) : V(V), adj(V) {}

    \/\/ Function to add an edge to the graph
    void addEdge(int v, int w) {
        adj[v].push_back(w);
    }

    \/\/ Function to perform topological sort
    bool topologicalSort(std::vector<int>& result) {
        std::vector<int> visited(V, 0); \/\/ 0: unvisited, 1: visiting, 2: visited
        std::stack<int> stack;

        for (int i = 0; i < V; ++i) {
            if (visited[i] == 0) {
                if (!dfs(i, visited, stack)) {
                    return false; \/\/ Cycle detected
                }
            }
        }

        \/\/ If there was no cycle, the topological ordering is in the stack
        while (!stack.empty()) {
            result.push_back(stack.top());
            stack.pop();
        }

        return true; \/\/ No cycles, topological sort successful
    }

private:
    \/\/ Utility function for topological sort
    bool dfs(int v, std::vector<int>& visited, std::stack<int>& stack) {
        if (visited[v] == 1) {
            return false; \/\/ Cycle detected
        }

        if (visited[v] == 2) {
            return true; \/\/ Already visited, skip
        }

        \/\/ Mark the current node as visiting
        visited[v] = 1;

        \/\/ Recur for all the vertices adjacent to this vertex
        for (int i : adj[v]) {
            if (!dfs(i, visited, stack)) {
                return false; \/\/ Cycle detected in the DFS subtree
            }
        }

        \/\/ Mark the current node as visited
        visited[v] = 2;
        \/\/ Push current vertex to the stack, which stores the result
        stack.push(v);

        return true;
    }
};

int main() {
    Graph g(6);
    g.addEdge(5, 2);
    g.addEdge(5, 0);
    g.addEdge(4, 0);
    g.addEdge(4, 1);
    g.addEdge(2, 3);
    g.addEdge(3, 1);

    std::vector<int> result;
    if (g.topologicalSort(result)) {
        std::cout << "Topological sort of the given graph:" << std::endl;
        for (int v : result) {
            std::cout << v << " ";
        }
        std::cout << std::endl;
    } else {
        std::cout << "The graph has a cycle, topological sort not possible." << std::endl;
    }

    return 0;
}
```

