type Picked = DeepPick<A, 'id' | 'address.street.name'>;
\/\/ Picked type is equivalent to:
\/\/ {
\/\/   id: string;
\/\/   address: {
\/\/     street: {
\/\/       name: string;
\/\/     };
\/\/   };
\/\/ }
```

Let's break down the `DeepPick` type:
- `Path extends `${infer Key}.${infer Rest}``: This conditional type checks if the `Path` is a template literal type with a `.` separator, meaning it's a nested path.
- `Key extends keyof T`: This checks if the first part of the path (before the `.`) is a key of the type `T`.
- `{ [K in Key]: DeepPick<T[Key], Rest> }`: This maps over the keys and recursively applies `DeepPick` to the nested properties.
- `Path extends keyof T`: This checks if the `Path` is a direct key of the type `T`.
- `{ [K in Path]: T[Path] }`: This creates a type with the picked properties if it's a direct key.

The above `DeepPick` type allows for picking nested paths, but it's essential to note that TypeScript's type system has its limits. Complex and deeply nested types may cause the compiler to hit recursion depth limits or performance issues. Always use such advanced types with caution and be aware of the potential impact on your codebase's maintainability and TypeScript's type checking performance.

