<script>
  function getRandomPastelColor() {
    \/\/ Generate random light colors (pastels)
    const base = 256;
    const offset = 127; \/\/ Adjust this to make colors lighter or darker
    const r = Math.floor(Math.random() * base) \/ 2 + offset;
    const g = Math.floor(Math.random() * base) \/ 2 + offset;
