To password protect an AWS S3 bucket's content, you can implement the following steps:

1. Open the AWS S3 Console and navigate to the bucket you want to protect.
2. Click on the "Permissions" tab.
3. Under "Block Public Access," ensure that all settings are configured to prevent public access to the bucket and its objects.
4. Next, click on the "Bucket Policy" button.
5. Add the following bucket policy to restrict access to only authenticated users:

```json
{
    "Version": "2012-10-17",
    "Statement": [
        {
            "Sid": "DenyUnauthenticatedAccess",
            "Effect": "Deny",
            "Principal": "*",
            "Action": "s3:GetObject",
            "Resource": "arn:aws:s3:::your-bucket-name\/*",
            "Condition": {
                "Bool": {
                    "aws:SecureTransport": "false"
                }
            }
        }
    ]
}
```

Replace "your-bucket-name" with the name of your S3 bucket.

6. Click on "Save" to apply the policy.

By implementing this bucket policy, you are denying access to any unauthenticated requests (requests without valid AWS credentials) to retrieve objects from your S3 bucket.
